import React, { Component } from 'react';
import Navigation from './Navigation/Navigation';
import TextFields from './TextFields/textfields';
import './App.css';


class App extends Component {

    constructor(props) {
        super(props);
        this.setState({
            'route' : 'signIn',
        });
    }

    render() {
    return (
      <div className="App">
          { 'signIn' === this.state.route ? <div>
              <Navigation/>
              <TextFields/>
          </div> : <Navigation/>
          }
      </div>
    );
  }
}

export default App;
